  // };

  return (
   <nav>
     <div className={`container`}>
      <img src={light_person } alt="" className='toggle-icon' />
      <img 
        // onClick={toggle_mode} // Change from onCanPlay to onClick
        src={ day_logo} 
        alt="" 
        className='toggle-icon' 
      />
    </div>
   </nav>

    
  );
};

export default Navbar;
